import React from 'react'

const Confirmation = ({ prevStep, nextStep, values }) => {
  
  const { estatetype, fullname, phone, email, region, district } = values
  const Continue = e => {
    e.preventDefault();
    nextStep();
  }

  const Previous = e => {
    e.preventDefault();
    prevStep();
  }

  return (
      <div>
        <ul>
            <li>Estate type: {estatetype}</li>
        </ul>

        
        <button 
            onClick={ Previous }
              type="submit"
            >
              Previous
            </button>

            <button 
              onClick={ Continue }
              type="submit"
            >
              Confirm & Continue
            </button>
      </div>
  )
}

export default Confirmation
